        "vaeua-gui-eua.linearTickValueFitPolicy.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.sas.van.interactionEffect.squared.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Effecten die bestaan uit het kwadraat van elk meetitem. Gekwadrateerde effecten die het volledige interactie-effect dupliceren, worden niet meegenomen.</p></section>',
        "vaeua-gui-eua.sas.van.splineEffect.complete.help.tip.txt": "Meer informatie over deze optie ",
