        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Hier ziet u de meest of minst aanbevolen categorieën voor elke categorievariabele. U moet minimaal één voorspeller toewijzen voordat u een voorspeller kunt kiezen.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.standardizationMethodlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is de methode die wordt gebruikt om de meetwaardevoorspellers te standaardiseren.</p></section>',
