        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.splittingCriterion.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Geeft aan hoeveel clusters moeten worden gemaakt of dat de ABC-methode (Aligned Box Criterion) moet worden gebruikt om het optimale aantal clusters af te leiden.</p><p class\\="xis-paragraph">Bij de ABC-methode wordt eerst het aantal te maken clusters gekozen, worden vervolgens de clusters gemaakt en wordt tot slot de kloofstatistiek voor elke cluster berekend. Vervolgens wordt een clusterspecifieke referentieverdeling gemaakt en wordt de kloofstatistiek voor elke referentieverdeling berekend. Dit proces wordt voor elk potentieel aantal clusters herhaald. Het aantal clusters waarmee het totale verschil tussen de kloofstatistiek van de clusters en de referentiegegevens wordt gemaximaliseerd, wordt als het optimale aantal clusters gekozen.</p><p class\\="xis-paragraph">De ABC-methode is alleen geldig wanneer alle invoerwaarden meetwaardevariabelen zijn.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Er wordt gebruikgemaakt van het standaardaantal voorspellers dat voor elke splitsing moet worden geprobeerd. De standaardwaarde is de vierkantswortel van het totale aantal voorspellers. Geef eventueel zelf een ander aantal voorspellers op.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is het aantal klassen dat u wilt gebruiken om meetwaardevariabelen te categoriseren in de plot van gedeeltelijke afhankelijkheid.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Met deze optie wordt het algoritme voor een snelle clustering op basis van k-gemiddelden ingeschakeld en wordt klasserangschikking genegeerd. Selecteer deze optie niet als u het “greedy” zoekalgoritme wilt gebruiken en klasserangschikking wilt aanhouden. Voor niet in klassen ingedeelde meetwaarderesponsen geldt Variantie als selectiecriterium. Wanneer deze optie is ingeschakeld, wordt voor categorieresponsen en in klassen ingedeelde meetwaarderesponsen het criterium Voordeelverhouding gebruikt. In andere gevallen wordt Absoluut voordeel gebruikt.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.barSpacing.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Probeert een naïve Bayesiaans netwerk en een met een Bayesiaans netwerk uitgebreid naïve Bayesiaans netwerk te maken. Bij een naïve Bayesiaans netwerk moet de responsvariabele de enige ouder voor alle voorspellers zijn. Er wordt een voorwaardelijke onafhankelijkheid van alle voorspellers verondersteld, uitgaande van de responsvariabele. Een met een Bayesiaans netwerk uitgebreid naïve Bayesiaans netwerk breidt het naïve netwerk uit door de voorspellerknopen een Bayesiaans netwerk te laten vormen.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.bayesNet.markovBlanket.help.tip.txt": "Meer informatie over deze optie ",
