        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is het relatieve aantal community’s (lokale knooppuntgroeperingen) dat moet worden berekend. De community’s worden dynamisch bijgewerkt wanneer het netwerk verandert.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Forceert niet-negatieve factoren met bias-termen die op nul moeten worden ingesteld. Dit kan tot betere prestaties leiden wanneer er heel weinig trainingsgegevens zijn.</p></section>',
