        "vaeua-gui-eua.Properties.neuralnetwork.activation.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is de activeringsfunctie die in de verborgen laag wordt gebruikt.</p></section>',
