        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Verwijder besturingselementen uit het promptgebied van de pagina om het volgende probleem op te lossen. Om bijvoorbeeld problemen met middelhoge prioriteit te voorkomen, kunt u het aantal besturingselementen in het promptgebied van de pagina beperken tot 10 of minder.</p><p class\\="xis-paragraph">Middelhoge prioriteit\\: bevat &gt; 10 objecten in het promptgebied van de pagina.</p></section>',
