        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Toetst elke voorspeller op voorwaardelijke onafhankelijkheid van de responsvariabele in het licht van elke andere voorspeller bij de opgegeven onafhankelijkheidstoets-statistiek. Als u <span class\\="xis-windowItem">Variabelenselectie gebruiken</span> selecteert, worden de voorspellers afgewezen die in het licht van een andere voorspeller voorwaardelijk onafhankelijk van de responsvariabele zijn.</p></section>',
