        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Pas de rapportindeling aan om geneste containers te voorkomen en de volgende problemen op te lossen. Om bijvoorbeeld problemen met hoge prioriteit te voorkomen, zorgt u ervoor dat er 6 of minder geneste containers in de rapportindeling zijn.</p><p class\\="xis-paragraph">Lage prioriteit\\: bevat &gt; 2 geneste containers</p><p class\\="xis-paragraph">Middelhoge prioriteit\\: bevat &gt; 4 geneste containers</p><p class\\="xis-paragraph">Hoge prioriteit\\: bevat &gt; 6 geneste containers</p></section>',
