        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Bepaalt of de termen worden geclassificeerd door de gebruiksrol Woordsoorten. Het woord “zit” bijvoorbeeld kan een werkwoord zijn in “Zij zit op de stoel”. In de zin “Het was een lange zit” is het echter een zelfstandig naamwoord.</p></section>',
