        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Bepaalt het gewicht van termen. Het termgewicht is een positief getal dat aan elke term wordt toegekend op basis van de distributie van die term in de documentenverzameling. Dit gewicht kan worden geïnterpreteerd als een indicatie van het belang van die term voor de documentenverzameling.</p></section>',
