        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Geeft aan of groepen moeten worden berekend en of de hoogste drie en laagste drie groepen in de resultaten moeten worden weergegeven. Er worden verschillende beslisbomen uitgevoerd op de opgegeven responsvariabele, en elke groep beschrijft een bladknooppunt in een van die beslisbomen.</p></section>',
        "vaeua-gui-eua.Properties.assessment.cutoff.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is het convergentiecriterium voor het component van de maximale gradiënt.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is de maximaal aanvaardbare validatiefout voor de afronding van de modeltraining. Wanneer de validatiefout kleiner is dan de opgegeven doelwaarde, wordt de modeltraining beëindigd.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "Meer informatie over deze optie ",
