        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Meer informatie over deze optie ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is de distributiefunctie die wordt gebruikt om de responsvariabele te modelleren.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Met de optie <span class\\="xis-windowItem">Roulering gegevenselementstijl</span> geeft u aan hoe stijlen worden toegewezen aan de gegevenselementen in de grafieksjabloon. In een lijndiagram bijvoorbeeld geeft deze optie aan hoe kleuren, lijnpatronen en markeringen worden gebruikt om lijnen in de grafiek van elkaar te onderscheiden. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisch</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">- De stijlrouleerinstelling van het thema wordt gebruikt. De meeste SAS-thema’s gebruiken de instelling <span class\\="xis-windowItem">Eerst alle kleuren rouleren</span>. Voor het thema High Contrast wordt de instelling <span class\\="xis-windowItem">Alle kenmerken rouleren</span> gebruikt.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Eerst alle kleuren rouleren</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">- Er worden een ononderbroken lijn met een effen opvulling en een uniforme markeringsvorm weergegeven totdat alle kleuren in het palet zijn gebruikt.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Alle kenmerken rouleren</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">- Er worden naast verschillende kleuren ook verschillende vulpatronen, lijnpatronen en markeervormen weergegeven. Deze instelling kan de inhoud toegankelijker maken voor gebruikers die kleurenblind zijn.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Help. Meer informatie over deze optie ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is de parameter \\#\\#schaal (coëfficiënt) in de sigmoïde functie.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dit is het aantal community’s (lokale knooppuntgroeperingen) dat moet worden berekend binnen elke cluster knooppunten. Het totale aantal berekende groepen kan kleiner zijn dan de geselecteerde waarde, afhankelijk van de netwerkopzet en omvang.</p></section>',
