        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Bij categorische voorspellers wordt een ontbrekende waarde behandeld als een afzonderlijke waarde. Bij een continue voorspeller wordt een ontbrekende waarde vervangen door het rekenkundige gemiddelde van de voorspeller. Voor Bayesiaans netwerken worden ontbrekende waarden niet in de responsvariabele opgenomen.</p></section>',
