        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Met de optie <span class\\="xis-windowItem">Groeperingsschaal</span> bepaalt u hoe gegroepeerde staafdiagrammen worden geschaald. De staven kunnen worden gestapeld of geclusterd. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Feitelijke waarden</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Hiermee wordt de grootte van de staven aangepast aan de waarden in de gegevens. Stel dat een staaf in één groep de waarde 50 heeft en een staaf in een andere groep de waarde 500 heeft. De staaf met de waarde 500 zou in dit geval 10 keer hoger zijn dan de staaf met de waarde 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Groepen normaliseren op 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Hiermee worden de groepen weergegeven op basis van een relatieve schaal. Elke staaf binnen een groep wordt als percentage van de groep weergegeven. Stel dat een groep een totale waarde van 100 heeft. Als een staaf binnen die groep de waarde 50 heeft, is de hoogte van de staaf 50% van de hoogte van de volledige groep.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Deze optie is niet beschikbaar wanneer het grafiekobject overlappende grafiekelementen bevat. De optie is evenmin beschikbaar wanneer u hetzelfde gegevensbereik opgeeft voor de assen in een rooster.</p></section>',
